import React from "react";
import { Switch, Route } from "react-router-dom/cjs/react-router-dom";
import Header from "./Header";

function App() {
  return (
    <>
      <Header />
      <Switch>
        <Route exact path="/" component={Home} />
      </Switch>
    </>
  );
}

export default App;
